export default function EventsPage() {
  const DUMMY_EVENTS = [
    { id: "e1", title: "event-1" },
    { id: "e2", title: "event-2" },
  ];

  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((e) => (
          <li key={e.id}>{e.title}</li>
        ))}
      </ul>
    </>
  );
}
